DROP TABLE IF EXISTS `eol_bill`;
CREATE TABLE `eol_bill`
(
    `id`                    bigint(20) NOT NULL,
    `bill_no`               varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '账单编号',
    `settlement_ent`        varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '结算对象',
    `payment_type`          varchar(65) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收付类型',
    `currency`              varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '账单币种',
    `currency_id`           bigint(30) NULL DEFAULT NULL COMMENT '账单币种Id',
    `exchange_rate`         varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '账单汇率',
    `multi_currency_amount` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '多币种金额',
    `total_amount_rmb`      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '折合人民币',
    `remark`                varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
    `bill_status`           int(10) NULL DEFAULT NULL COMMENT '账单状态',
    `revision`              int(11) NULL DEFAULT NULL COMMENT '乐观锁',
    `created_by`            bigint(20) NULL DEFAULT NULL COMMENT '创建人',
    `created_time`          datetime NULL DEFAULT NULL COMMENT '创建时间',
    `updated_by`            bigint(20) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time`          datetime NULL DEFAULT NULL COMMENT '更新时间',
    `status`                int(1) UNSIGNED ZEROFILL NOT NULL DEFAULT 0 COMMENT '删除',
    `member_id`             bigint(20) NOT NULL COMMENT '企业ID',
    `member_name`           varchar(65) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业名称',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '账单表' ROW_FORMAT = DYNAMIC;

