-- ----------------------------
-- Table structure for hmm_order
-- ----------------------------
DROP TABLE IF EXISTS `hmm_order`;
CREATE TABLE `hmm_order`
(
    `id`                         bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
    `order_number`               varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单编号',
    `member_id`                  bigint(20) NULL DEFAULT NULL COMMENT '企业Id',
    `staff_id`                   bigint(20) NULL DEFAULT NULL COMMENT '个人id',
    `order_type`                 int(10) NULL DEFAULT NULL COMMENT '订单类型0会员1应用',
    `order_status`               int(11) NOT NULL DEFAULT 0 COMMENT '订单状态  0进行中   1已完成   2取消交易',
    `pay_status`                 int(11) NULL DEFAULT NULL COMMENT '支付状态0未付款1已付款2已取消',
    `user_name`                  varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户名称',
    `actual_paymet`              decimal(20, 2) NULL DEFAULT NULL COMMENT '实付金额',
    `total_amount`               decimal(20, 2) NULL DEFAULT NULL COMMENT '订单总价',
    `discount_amount`            decimal(20, 2) NULL DEFAULT NULL COMMENT '折扣金额',
    `pay_unit`                   varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付单位',
    `pay_type`                   varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付方式标识',
    `remark`                     varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
    `status`                     int(1) NOT NULL DEFAULT 0 COMMENT '删除',
    `revision`                   int(11) NOT NULL DEFAULT 0 COMMENT '乐观锁',
    `end_time`                   datetime NULL DEFAULT NULL COMMENT '到期时间',
    `pay_time`                   datetime NULL DEFAULT NULL COMMENT '支付时间',
    `created_by`                 bigint(20) NULL DEFAULT NULL COMMENT '创建人（下单用户）',
    `created_time`               datetime NULL DEFAULT NULL COMMENT '创建时间',
    `updated_by`                 bigint(20) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time`               datetime NULL DEFAULT NULL COMMENT '更新时间',
    `goods_name`                 varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品名称',
    `goods_id`                   bigint(20) NULL DEFAULT NULL COMMENT '应用id',
    `shop_id`                    bigint(20) NULL DEFAULT NULL COMMENT '店铺id',
    `goods_category_id`          bigint(20) NULL DEFAULT NULL COMMENT '商品分类ID',
    `goods_parent_category_id`   varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品父类型id',
    `goods_category_name`        varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品分类名称',
    `attribute_id`               bigint(50) NULL DEFAULT NULL COMMENT '规格id',
    `attribute_name`             varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '规格名称',
    `attribute_describe`         varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '规格描述（订单规格所有关联信息）',
    `term`                       int(50) NOT NULL DEFAULT 0 COMMENT '应用使用时间',
    `term_unit`                  varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '时间单位',
    `channel_id`                 varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '渠道支付id',
    `is_channel_close`           int(10) NULL DEFAULT NULL COMMENT '渠道是否关闭',
    `type`                       varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '类型升级，续费',
    `is_invoice`                 int(10) NULL DEFAULT NULL COMMENT '是否开票0否1是',
    `synch_state`                int(10) NULL DEFAULT NULL COMMENT '同步状态0否1是',
    `routing_detail`             varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '分佣情况',
    `clearing`                   int(10) NULL DEFAULT NULL COMMENT '是否结算0否1是',
    `apply`                      int(10) NULL DEFAULT NULL COMMENT '0个人1企业',
    `issue_id`                   bigint(20) NULL DEFAULT NULL COMMENT '发布人id',
    `issue_name`                 varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '发布人名称',
    `pay_url`                    varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付url',
    `member_name`                varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业用户名称',
    `pay_order_no`               varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付订单号',
    `goods_parent_category_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '应用父分类名称',
