    `div_members`     varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '分账对象信息',
    `clos_status`     int(1) NULL DEFAULT NULL COMMENT '结算状态0未结算, 1已结算',
    `description`     varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '附加说明',
    `fee_mode`        varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '手续费收取模式',
    `revision`        int(11) NULL DEFAULT NULL COMMENT '乐观锁',
    `created_by`      bigint(20) NULL DEFAULT NULL COMMENT '创建人',
    `created_time`    datetime NULL DEFAULT NULL COMMENT '创建时间',
    `updated_by`      bigint(20) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time`    datetime NULL DEFAULT NULL COMMENT '更新时间',
    `status`          int(1) UNSIGNED ZEROFILL NOT NULL COMMENT '删除',
    `order_type_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单类型',
    `account_time`    int(6) NULL DEFAULT NULL COMMENT '结算日期',
    `money`           decimal(10, 2) NULL DEFAULT NULL COMMENT '结算金额',
    `pay_order_no`    varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付订单号',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '分账表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of pay_sub_account
-- ----------------------------

-- ----------------------------
-- Table structure for pay_user
-- ----------------------------
DROP TABLE IF EXISTS `pay_user`;
CREATE TABLE `pay_user`
(
    `id`                         varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'adapay用户ID',
    `member_id`                  bigint(20) NOT NULL COMMENT '企业ID,或者用户ID',
    `user_type`                  int(1) NOT NULL COMMENT '1:staffId个人,2:memberId',
    `location`                   varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户地址',
    `email`                      varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户邮箱',
    `gender`                     varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'MALE：男，FEMALE：女，为空时表示未填写',
    `name`                       varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名称或者企业名称',
    `tel_no`                     varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户手机号，使用 收银台对象 功能必填 若创建用户对象用于分账功能，则手机号字段一定不要上送',
    `user_name`                  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户姓名',
    `cert_type`                  varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '证件类型，仅支持：00-身份证',
    `cert_id`                    varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '证件号，使用 收银台对象 功能必填 若创建用户对象用于分账功能，则证件号字段一定不要上送',
    `order_no`                   varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '请求订单号，只能为英文、数字或者下划线的一种或多种组合，保证在app_id下唯一',
    `social_credit_code`         varchar(18) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '统一社会信用代码',
    `social_credit_code_expires` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '统一信用代码有效期',
    `business_scope`             varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '经营范围',
    `legal_person`               varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '法人姓名',
    `legal_cert_id`              varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '法人身份证号',
    `legal_cert_id_expires`      varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '法人身份证有效期',
    `legal_mp`                   varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '法人手机号',
    `address`                    varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '企业地址',
    `zip_code`                   varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮编',
    `telphone`                   varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '企业电话',
    `attach_file`                varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '上传附件',
    `bank_code`                  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '银行代码',
    `settle_count_id`            varchar(65) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '结算账户ID',
    `bank_acct_type`             varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '银行账户类型1-对公2-对私如果需要自动开结算账户',
    `card_no`                    varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '银行卡号',
    `card_name`                  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '银行卡对应的户名',
    `bank_tel_no`                varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '银行预留手机号',
    `prov_code`                  varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '银行账户开户银行所在省份编码',
    `area_code`                  varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '银行账户开户银行所在地区编码',
    `is_settle_account`          int(1) NULL DEFAULT NULL COMMENT '是否是结算账户1是0否',
    `is_freeze`                  int(1) NULL DEFAULT NULL COMMENT '是否冻结1是0否',
    `revision`                   int(11) NULL DEFAULT NULL COMMENT '乐观锁',
    `created_by`                 bigint(20) NULL DEFAULT NULL COMMENT '创建人',
    `created_time`               datetime NULL DEFAULT NULL COMMENT '创建时间',
    `updated_by`                 bigint(20) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time`               datetime NULL DEFAULT NULL COMMENT '更新时间',
    `status`                     int(1) UNSIGNED ZEROFILL NOT NULL COMMENT '删除',
    `app_id`                     varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
    `settle_account_id`          varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '结算账户ID',
    `bank_name`                  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '汇付用户表' ROW_FORMAT = DYNAMIC;

