-- Records of pay_user
-- ----------------------------

-- ----------------------------
-- Table structure for pay_withdraw_deposit
-- ----------------------------
DROP TABLE IF EXISTS `pay_withdraw_deposit`;
CREATE TABLE `pay_withdraw_deposit`
(
    `id`                bigint(20) NOT NULL AUTO_INCREMENT,
    `adapay_user_id`    varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '汇付用户ID',
    `withdrawal_way`    int(255) NULL DEFAULT NULL COMMENT '提现方式',
    `bank_card`         varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '银行卡尾号',
    `into_time`         datetime NULL DEFAULT NULL COMMENT '到账时间',
    `money`             decimal(65, 2) NULL DEFAULT NULL COMMENT '到账金额',
    `withdrawal_status` int(255) NULL DEFAULT NULL COMMENT '到账状态,0未到账,1已经到账,2失败',
    `revision`          int(11) NULL DEFAULT NULL COMMENT '乐观锁',
    `created_by`        bigint(20) NULL DEFAULT NULL COMMENT '创建人',
    `created_time`      datetime NULL DEFAULT NULL COMMENT '创建时间',
    `updated_by`        bigint(20) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time`      datetime NULL DEFAULT NULL COMMENT '更新时间',
    `status`            int(1) UNSIGNED ZEROFILL NOT NULL COMMENT '删除',
    `withdrawal_no`     varchar(65) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '提现单号',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '提现表' ROW_FORMAT = DYNAMIC;

