-- Records of pay_withdraw_deposit
-- ----------------------------

-- ----------------------------
-- Table structure for pms_catalog
-- ----------------------------
DROP TABLE IF EXISTS `pms_catalog`;
CREATE TABLE `pms_catalog`
(
    `id`                 bigint(20) NOT NULL COMMENT 'id',
    `parent_id`          bigint(20) NULL DEFAULT NULL COMMENT '上机分类的编号：0表示一级分类',
    `name`               varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'name',
    `level`              int(11) NULL DEFAULT NULL COMMENT '分类级别：0->1级；1->2级',
    `channel_section_id` int(11) NULL DEFAULT NULL COMMENT '是否显示在导航栏：0->不显示；1->显示',
    `show_status`        int(11) NULL DEFAULT NULL COMMENT '显示状态：0->不显示；1->显示',
    `sort`               int(11) NULL DEFAULT NULL COMMENT 'sort',
    `icon`               varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '图标',
    `keywords`           varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'keywords',
    `description`        text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '描述',
    `member_id`          bigint(20) NULL DEFAULT NULL COMMENT '企业ID',
    `revision`           int(11) NULL DEFAULT NULL COMMENT '乐观锁',
    `created_by`         int(11) NULL DEFAULT NULL COMMENT '创建人',
    `created_time`       datetime NULL DEFAULT NULL COMMENT '创建时间',
    `updated_by`         int(11) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time`       datetime NULL DEFAULT NULL COMMENT '更新时间',
    `status`             int(11) NULL DEFAULT NULL COMMENT '删除',
    `width`              varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '宽度',
    `is_moudle`          int(20) NULL DEFAULT NULL COMMENT '是否为模块0否1是',
    `moudle_name`        varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '模板名称',
    PRIMARY KEY (`id`) USING BTREE,
    INDEX                `channel_section_id_index`(`channel_section_id`) USING BTREE,
    INDEX                `section_id_parent_id_index`(`channel_section_id`, `parent_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '频道栏目分类' ROW_FORMAT = Dynamic;

