-- ----------------------------
-- Table structure for pms_catalog_detail
-- ----------------------------
DROP TABLE IF EXISTS `pms_catalog_detail`;
CREATE TABLE `pms_catalog_detail`
(
    `id`           bigint(20) NOT NULL COMMENT 'ID',
    `catalog_id`   bigint(20) NULL DEFAULT NULL COMMENT '分类目录ID',
    `section_id`   int(11) NULL DEFAULT NULL COMMENT '栏目ID',
    `content_type` char(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '内容类型,商品、文章、企业等',
    `content`      text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '内容, 以 JSON 的格式保存',
    `revision`     int(11) NULL DEFAULT NULL COMMENT '乐观锁',
    `created_by`   int(11) NULL DEFAULT NULL COMMENT '创建人',
    `created_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
    `updated_by`   int(11) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
    `status`       int(11) NULL DEFAULT NULL COMMENT '删除',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '分类目录详情' ROW_FORMAT = Dynamic;

