DROP TABLE IF EXISTS `sms_home_advertise`;
CREATE TABLE `sms_home_advertise`
(
    `id`          bigint(20) NOT NULL AUTO_INCREMENT,
    `name`        varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
    `type`        int(11) NULL DEFAULT NULL COMMENT '轮播位置：0->PC慧贸贸首页轮播；2->PC慧品库首页轮播；3->PC慧服务首页轮播；4->PC慧学苑首页轮播；5->PC轻应用首页轮播；1->app首页轮播',
    `pic`         varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
    `start_time`  datetime NULL DEFAULT NULL,
    `end_time`    datetime NULL DEFAULT NULL,
    `status`      int(11) NULL DEFAULT NULL COMMENT '上下线状态：0->下线；1->上线',
    `click_count` int(11) NULL DEFAULT NULL COMMENT '点击数',
    `order_count` int(11) NULL DEFAULT NULL COMMENT '下单数',
    `url`         varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '链接地址',
    `note`        varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
    `sort`        int(11) NULL DEFAULT 0 COMMENT '排序',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 996629161294565377 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '首页轮播广告表' ROW_FORMAT = Dynamic;

