-- ----------------------------
-- Table structure for uac_aptitudes_member
-- ----------------------------
DROP TABLE IF EXISTS `uac_aptitudes_member`;
CREATE TABLE `uac_aptitudes_member`
(
    `id`               bigint(50) NOT NULL AUTO_INCREMENT,
    `aptitudes_id`     bigint(50) NULL DEFAULT NULL COMMENT '资质id',
    `staff_id`         bigint(50) NULL DEFAULT NULL COMMENT '个人id',
    `member_id`        bigint(50) NULL DEFAULT NULL COMMENT '企业id',
    `sgs_stutas`       int(10) NULL DEFAULT NULL COMMENT '认证状态0未认证1未通过2审核中3已入驻',
    `status`           int(11) NOT NULL DEFAULT 0 COMMENT '删除',
    `revision`         int(11) NOT NULL DEFAULT 0 COMMENT '乐观锁',
    `certificate_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '证件类型',
    `Id_photo`         varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '证件照片',
    `rankType`         int(10) NULL DEFAULT NULL COMMENT '企业用户身份',
    `authorization`    varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '授权书照片',
    `application_time` datetime NULL DEFAULT NULL COMMENT '企业资质申请时间',
    `application_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '申请人',
    `auditor`          varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核人',
    `excuse`           varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '不通过理由',
    `person_id`        bigint(50) NULL DEFAULT NULL COMMENT '法人身份证号',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '认证企业关联表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of uac_aptitudes_member
-- ----------------------------

