-- Table structure for uac_member_shop
-- ----------------------------
DROP TABLE IF EXISTS `uac_member_shop`;
CREATE TABLE `uac_member_shop`
(
    `ID`               bigint(20) NOT NULL,
    `shop_name`        varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '店铺名称',
    `shop_description` varchar(3000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '店铺描述',
    `shop_logo`        varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '店铺图标',
    `shop_banner`      varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '店铺宣传图',
    `shop_status`      int(32) NULL DEFAULT NULL COMMENT '开通状态',
    `member_id`        bigint(20) NULL DEFAULT NULL COMMENT '企业ID',
    `member_name`      varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业名称',
    `created_time`     timestamp NULL DEFAULT NULL COMMENT '创建时间',
    `updated_time`     timestamp NULL DEFAULT NULL COMMENT '更新时间',
    `kind_id`          bigint(20) NULL DEFAULT NULL COMMENT '企业类型',
    `logo_img`         varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业图片',
    `shop_type`        varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '店铺类型',
    `revision`         int(11) NOT NULL DEFAULT 0 COMMENT '乐观锁',
    `status`           int(1) NOT NULL DEFAULT 0 COMMENT '删除',
    PRIMARY KEY (`ID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '企业店铺' ROW_FORMAT = DYNAMIC;

