-- ----------------------------
-- Table structure for uac_shop_category
-- ----------------------------
DROP TABLE IF EXISTS `uac_shop_category`;
CREATE TABLE `uac_shop_category`
(
    `id`                   bigint(20) NOT NULL,
    `shop_id`              bigint(20) NULL DEFAULT NULL COMMENT '店铺ID',
    `category_id`          bigint(20) NULL DEFAULT NULL COMMENT '类目ID',
    `category_name`        varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '类目名称',
    `category_status`      int(11) NULL DEFAULT NULL COMMENT '类目审核状态1:审核通过,2未审核',
    `category_parent_id`   bigint(20) NULL DEFAULT NULL COMMENT '类目上级ID',
    `category_parent_name` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '类目上级名称',
    `member_id`            bigint(20) NULL DEFAULT NULL COMMENT '企业ID',
    `ccie_img`             varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '资质证书照片',
    `is_parent`            int(4) NULL DEFAULT NULL COMMENT '是否是父级',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '店铺经营类目' ROW_FORMAT = DYNAMIC;

