DROP TABLE IF EXISTS `uaw_aptitudes`;
CREATE TABLE `uaw_aptitudes`
(
    `id`                  bigint(50) NOT NULL AUTO_INCREMENT,
    `vip_type_id`         bigint(50) NULL DEFAULT NULL COMMENT '会员类型id',
    `member_id`           bigint(50) NULL DEFAULT NULL COMMENT '企业id',
