    `member_papers`       text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '企业证件',
    `vip_type_name`       varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '类型名称',
