    `auditor`             varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '审核人',
    `created_by_id`       bigint(20) NULL DEFAULT NULL COMMENT '申请人ID',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1187034886611927149 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '入驻申请表' ROW_FORMAT = DYNAMIC;

