-- ----------------------------
-- Table structure for uaw_rights
-- ----------------------------
DROP TABLE IF EXISTS `uaw_rights`;
CREATE TABLE `uaw_rights`
(
    `id`               bigint(20) NOT NULL AUTO_INCREMENT,
    `rights_name`      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '权益名称',
    `revision`         int(11) NOT NULL DEFAULT 0 COMMENT '乐观锁',
    `status`           int(11) NOT NULL DEFAULT 0 COMMENT '删除',
    `resource_id`      bigint(20) NULL DEFAULT NULL COMMENT '资源id',
    `ico`              varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '图标1',
    `ico_t`            varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '图标2',
    `rights_type_id`   bigint(50) NULL DEFAULT NULL COMMENT '权益分类id',
    `use_pattern`      int(10) NULL DEFAULT NULL COMMENT '使用方式0线上1线下',
    `description`      text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '权益项描述',
    `resource_name`    varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '应用地址',
    `rights_type_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 947904848727113729 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '权益项表' ROW_FORMAT = DYNAMIC;

