    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 947903375339421697 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '权益类型表' ROW_FORMAT = DYNAMIC;

