-- ----------------------------
-- Table structure for uaw_vip_class
-- ----------------------------
DROP TABLE IF EXISTS `uaw_vip_class`;
CREATE TABLE `uaw_vip_class`
(
    `id`                  bigint(50) NOT NULL AUTO_INCREMENT,
    `class_name`          varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员等级名称',
    `type_id`             bigint(50) NULL DEFAULT NULL COMMENT '所属会员类型id',
    `introduce`           varchar(3000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员等级介绍',
    `description`         varchar(3000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '描述开通方式',
    `remark`              varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注（开通方式）',
    `ico`                 varchar(288) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '图标（小钻石）',
    `picture`             varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '图片（大）',
    `status`              int(11) NOT NULL DEFAULT 0 COMMENT '删除',
    `revision`            int(11) NOT NULL DEFAULT 0 COMMENT '乐观锁',
    `workbench_url`       varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '对应工作台链接',
    `term`                int(50) NOT NULL DEFAULT 0 COMMENT '会员使用时间',
    `term_unit`           varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '时间单位',
    `price` double (20, 2) NULL DEFAULT NULL COMMENT '价格',
    `price_unit`          varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '价格单位',
    `opening_condition`   int(5) NULL DEFAULT NULL COMMENT '开通条件(是否需要个人实名认证)',
    `sort`                int(10) NULL DEFAULT NULL COMMENT '顺序',
    `created_by`          bigint(20) NULL DEFAULT NULL COMMENT '创建人',
    `created_time`        datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
    `updated_by`          bigint(20) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time`        datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    `class_serial_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员等级编号',
    `is_start_using`      int(10) NOT NULL COMMENT '是否启用0否1是',
