-- ----------------------------
-- Table structure for uaw_vip_order
-- ----------------------------
DROP TABLE IF EXISTS `uaw_vip_order`;
CREATE TABLE `uaw_vip_order`
(
    `id`           bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
    `order_number` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单编号',
    `member_id`    bigint(20) NULL DEFAULT NULL COMMENT '企业Id',
    `staff_id`     bigint(20) NULL DEFAULT NULL COMMENT '个人id',
    `order_status` int(11) NOT NULL DEFAULT 0 COMMENT '订单状态0进行中1已完成2取消交易3已结算',
    `pay_status`   int(11) NULL DEFAULT NULL COMMENT '支付状态0未付款1已付款',
    `total_amount` double (10, 2) NULL DEFAULT NULL COMMENT '订单总价',
    `pay_unit`     varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '支付单位',
    `vip_type_id`  bigint(20) NULL DEFAULT NULL COMMENT '会员类型id',
    `pay_type`     int(10) NULL DEFAULT NULL COMMENT '支付方式0线上1线下',
    `remark`       varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
    `status`       int(11) NOT NULL DEFAULT 0 COMMENT '删除',
    `revision`     int(11) NOT NULL DEFAULT 0 COMMENT '乐观锁',
    `end_time`     datetime NULL DEFAULT NULL COMMENT '到期时间',
    `pay_time`     datetime NULL DEFAULT NULL COMMENT '支付时间',
    `class_name`   varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员等级名称',
    `order_type`   int(10) NULL DEFAULT NULL COMMENT '订单类型0个人1企业',
    `created_by`   bigint(20) NULL DEFAULT NULL COMMENT '创建人',
    `created_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
    `updated_by`   bigint(20) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '会员订单表' ROW_FORMAT = DYNAMIC;

