DROP TABLE IF EXISTS `uaw_vip_postpone`;
CREATE TABLE `uaw_vip_postpone`
(
    `id`                  bigint(20) NOT NULL,
    `operator_id`         bigint(20) NULL DEFAULT NULL COMMENT '操作人id',
    `operator`            varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作人姓名',
    `operator_time`       datetime NULL DEFAULT NULL COMMENT '操作时间',
    `member_id`           bigint(20) NULL DEFAULT NULL COMMENT '被操作企业id',
    `member_name`         varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '被操作企业名称',
    `class_serial_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作会员等级编号',
    `mamber_name`         varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '操作会员等级名称',
    `day`                 int(50) NULL DEFAULT NULL COMMENT '延期天数（单位：天）',
    `vip_type_name`       varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员类型名称',
    `vip_type_id`         bigint(20) NULL DEFAULT NULL COMMENT '会员类型名称',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '会员延期记录表' ROW_FORMAT = DYNAMIC;

