-- ----------------------------
-- Table structure for uaw_vip_type
-- ----------------------------
DROP TABLE IF EXISTS `uaw_vip_type`;
CREATE TABLE `uaw_vip_type`
(
    `id`                   bigint(50) NOT NULL AUTO_INCREMENT,
    `type_name`            varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员类型名称',
    `group_id`             bigint(50) NULL DEFAULT NULL COMMENT '会员类型分组id',
    `ico`                  varchar(288) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '未选中',
    `picture`              varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '选中',
    `status`               int(11) NOT NULL DEFAULT 0 COMMENT '删除',
    `revision`             int(11) NOT NULL DEFAULT 0 COMMENT '乐观锁',
    `description`          varchar(3000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '类型描述',
    `workbench`            bigint(50) NULL DEFAULT NULL COMMENT '对应工作台',
    `is_audit_required`    int(5) NULL DEFAULT NULL COMMENT '是否需要审核0否1是',
    `default_vip_class_id` bigint(50) NULL DEFAULT NULL COMMENT '默认开通会员等级id',
    `created_by`           bigint(20) NULL DEFAULT NULL COMMENT '创建人',
    `created_time`         datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
    `updated_by`           bigint(20) NULL DEFAULT NULL COMMENT '更新人',
    `updated_time`         datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    `is_default_vip`       int(10) NOT NULL DEFAULT 0 COMMENT '是否为默认会员0否1是',
    `code`                 varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '工作台标识',
    `vip_type_status`      int(5) NULL DEFAULT NULL COMMENT '会员类型状态0启用1禁用',
    `shop_type_name`       varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '店铺类型名称',
    `rights_ico`           varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '权益对比图',
    `sort`                 int(20) NULL DEFAULT NULL COMMENT '排序',
    `relevancy_type_id`    varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '关联类型id',
    PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 959530773524774913 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '会员分类表' ROW_FORMAT = DYNAMIC;

