DROP TABLE IF EXISTS `uaw_vip_type_group`;
CREATE TABLE `uaw_vip_type_group`
(
    `id`             bigint(50) NOT NULL AUTO_INCREMENT,
    `group_name`     varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '会员类型分组名称',
    `apply`          int(10) NULL DEFAULT NULL COMMENT '所属适用于0个人/1企业',
    `status`         int(11) NOT NULL DEFAULT 0 COMMENT '删除',
