-- ----------------------------
-- Table structure for uaw_workbench_menu
-- ----------------------------
DROP TABLE IF EXISTS `uaw_workbench_menu`;
CREATE TABLE `uaw_workbench_menu`
(
    `id`            bigint(50) NOT NULL AUTO_INCREMENT,
    `parent_id`     bigint(50) NULL DEFAULT NULL COMMENT '菜单父id',
    `icon`          varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '菜单图标',
    `workbench_id`  bigint(50) NULL DEFAULT NULL COMMENT '所属工作台id或应用id',
    `type`          int(11) NULL DEFAULT NULL COMMENT '资源类型1.菜单2.按钮',
    `cache`         int(11) NULL DEFAULT NULL COMMENT '是否缓存',
    `component`     varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '组件',
    `create_time`   datetime NULL DEFAULT NULL COMMENT '创建时间',
    `hidden`        int(11) NULL DEFAULT NULL COMMENT '是否菜单可见',
    `iframe`        int(11) NULL DEFAULT NULL COMMENT '是否内嵌',
    `iframe_url`    varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '内嵌框架地址',
    `level`         int(11) NULL DEFAULT NULL COMMENT '层级',
    `name`          varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '路由名称',
    `path`          varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '地址',
    `permission`    varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '权限',
    `redirect`      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '重定向地址',
    `sort`          int(50) NULL DEFAULT NULL COMMENT '排序',
    `title`         varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '菜单名称',
    `platform_type` int(11) NULL DEFAULT NULL COMMENT '平台类型(1.服务平台2.运营平台3.独立应用)',
    `status`        int(11) NOT NULL DEFAULT 0 COMMENT '删除',
    `revision`      int(11) NOT NULL DEFAULT 0 COMMENT '乐观锁',
    `is_default`    int(11) NULL DEFAULT NULL COMMENT '是否为默认菜单',
    `is_hidden`     varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '是否显示',
    `button_name`   varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '按钮名称',
    `button_path`   varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '按钮地址',
    `web_sys`       varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '页面所属系统',
    `button_type`   varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '按钮类型',
    `is_group`      int(11) NULL DEFAULT NULL COMMENT '是否分组',
    PRIMARY KEY (`id`) USING BTREE,
    INDEX           `parent_id`(`parent_id`) USING BTREE,
    INDEX           `workbench_id`(`workbench_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1175035460578181284 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = DYNAMIC;

